import React, { lazy, Suspense } from "react";
import "./css/Home.css";
import Index1 from "./Index1";
// import Index2 from "./Index2";
const Index2 = lazy(() => import("./Index2"));

function Home() {
  return (
    <div className="index-wrapper">
      <div id="top"></div>
      <Index1 />
      <Suspense fallback={<div>Loading...</div>}>
        <Index2 />
      </Suspense>
    </div>
  );
}

export default Home;
